import event from './event';
import { repTypes } from '../../config';
var force = false;
/** 弹框展示 */
export function dialogView(metaId, extra) {
    force = false;
    base(metaId, extra);
}
export function dialogViewForce(metaId, extra) {
    force = true;
    base(metaId, extra);
}
function base(metaId, extra) {
    return event.bind(this)(metaId, repTypes.UBT.subTypes.DIALOG_VIEW, extra, force);
}
